INSERT INTO `blog_article` VALUES ('a9455e9f36bc4f33ba01412a64d87d6a', '26873592', '记一次spring boot 功能模块化 freemarker只能识别一个resources目录下前端展示模板问题', 'https://static.oschina.net/uploads/space/2018/0116/183901_IMPm_3312115.png', '<p>今天开发个人开源框架，完善了系统模块后，集成工作流功能模块，在新的resources下面新建freemarker前端页面(ftl页面)，然后正常开发到展示流程表的时候，后台报错情景重新：<strong>Could not resolve view with name \'/actList\' in servlet with name \'dispatcherServlet\'&nbsp;</strong></p><p><img src=\"https://static.oschina.net/uploads/space/2018/0116/183901_IMPm_3312115.png\" height=\"263\" width=\"793\"></p><p>当时我就想是不是映射地址出错了，检查多次后发现也没错，怎么spring mvc就映射不到呢，而且是相同的的地址路径(模块不一样)，和其他模块resources一致的路径，然后我系统模块是完全没问题的，我感觉应该是freemarker配置的问题，然后各种尝试，各种检查，各种查阅资料，发现，的确是freemarker的问题，我少配置了一项freemarker配置：<strong>FreeMarkerConfigurationFactory</strong>类下的属性：<strong>preferFileSystemAccess，&lt;---对就是它，</strong>我们来看源码发现默认是<strong>true</strong></p><pre class=\"ql-syntax\" spellcheck=\"false\">public class FreeMarkerConfigurationFactory {\n\n	protected final Log logger = LogFactory.getLog(getClass());\n\n	private Resource configLocation;\n\n	private Properties freemarkerSettings;\n\n	private Map&lt;String, Object&gt; freemarkerVariables;\n\n	private String defaultEncoding;\n\n	private final List&lt;TemplateLoader&gt; templateLoaders = new ArrayList&lt;TemplateLoader&gt;();\n\n	private List&lt;TemplateLoader&gt; preTemplateLoaders;\n\n	private List&lt;TemplateLoader&gt; postTemplateLoaders;\n\n	private String[] templateLoaderPaths;\n\n	private ResourceLoader resourceLoader = new DefaultResourceLoader();\n\n	private boolean preferFileSystemAccess = true;\n</pre><p>那么他是干嘛用的呢，我们看官方介绍是介绍：</p><p>Set whether to prefer file system access for template loading. File system access enables hot detection of template changes.</p><p>If this is enabled, FreeMarkerConfigurationFactory will try to resolve the specified \"templateLoaderPath\" as file system resource (which will work for expanded class path resources and ServletContext resources too).</p><p>Default is \"true\". Turn this off to always load via SpringTemplateLoader (i.e. as stream, without hot detection of template changes), which might be necessary if some of your templates reside in an expanded classes directory while others reside in jar files.</p><p>我们随便翻一下：第一句的意思是是否以更喜欢方式来访问模板</p><p>如果启用就以templateLoaderPath设置的路径来加载，默认为true，设置为false的话就以SpringTemplateLoader方式访问，那么就是流的方式访问，这可能是必要的,如果你的一些模板驻留在一个扩展的类而其他人驻留在jar文件的目录。</p><p>意思就是 如果你的文件在jar包文件目录下，就有必要设置为false，我们是多模块的，最终只运行一个模块，其他模块都是以jar包来加载的，我们要加载jar包里面的文件目录，必须要把这个属性设置为false才行，debug源码看看，先上配置文件：</p><pre class=\"ql-syntax\" spellcheck=\"false\">@Bean\n  public FreeMarkerConfigurer freemarkerConfig() throws IOException, TemplateException {\n    FreeMarkerConfigurationFactory factory = new FreeMarkerConfigurationFactory();\n    factory.setTemplateLoaderPath(\"classpath:/ftl/\");\n    factory.setDefaultEncoding(\"UTF-8\");\n    factory.setPreferFileSystemAccess(true);\n    FreeMarkerConfigurer result = new FreeMarkerConfigurer();\n    freemarker.template.Configuration configuration = factory.createConfiguration();\n    configuration.setClassicCompatible(true);\n    result.setConfiguration(configuration);\n    Properties settings = new Properties();\n    settings.put(\"template_update_delay\", \"0\");\n    settings.put(\"default_encoding\", \"UTF-8\");\n    settings.put(\"number_format\", \"0.######\");\n    settings.put(\"classic_compatible\", true);\n    settings.put(\"template_exception_handler\", \"ignore\");\n    result.setFreemarkerSettings(settings);\n    return result;\n  }\n</pre><p><strong>FreeMarkerConfigurationFactory</strong></p><p><img src=\"https://static.oschina.net/uploads/space/2018/0116/190228_Oq2F_3312115.png\" height=\"255\" width=\"1260\"></p><p>返回<img src=\"https://static.oschina.net/uploads/space/2018/0116/190505_StVf_3312115.png\" height=\"56\" width=\"781\"></p><p>最终返回：</p><p><img src=\"https://static.oschina.net/uploads/space/2018/0116/191335_abkt_3312115.png\" height=\"190\" width=\"1162\"></p><p>看到没，是单个模块的绝对路径ftl文件夹。</p><p>看图我们可以明确知道为true的话，加载的是设置的setTemplateLoaderPath的路径 也就是我其中一个模块下的ftl路径，所以<strong>其他模块下ftl路径是加载不出来的</strong>，也就<strong>是spring mvc 映射不到的原因。</strong></p><p>我们试试 将<strong>isPreferFileSystemAccess</strong>设置为<strong>false：</strong></p><p><img src=\"https://static.oschina.net/uploads/space/2018/0116/190741_z84S_3312115.png\" height=\"460\" width=\"947\"></p><p>最终我们跟到这里：</p><p><img src=\"https://static.oschina.net/uploads/space/2018/0116/191129_wHTf_3312115.png\" height=\"353\" width=\"952\"></p><p>发现路径是/ftl/而不是之前的绝对路径，然后set进spring对freemarker的配置对象中。</p><p>好的，我们通过分析源码我们可以知道，多模块下，我们<strong>设置为false，spring才能以相对路径来访问我们的模板文件夹</strong>，问题解决。</p>', '17', '1', 'acfc0e9232f54732a5d9ffe9071bf572', 'a4a743bffe9711e7b472201a068c6482', '2018-11-25 13:48:54', '2018-11-25 22:12:53', '0');
INSERT INTO `blog_article` VALUES ('fd27b3ed7d344395b7766f596bf6fd06', '36152428', 'spring boot 2.0 集成shiro注意事项', null, '<p><span style=\"color: rgb(61, 70, 77);\">spring boot 2.0 全面拥抱java8，在安全验证上面 很大程度的简化了配置项，用shiro就要把security关闭， security 默认是开启的，在boot1.x版本可以通过配置项</span></p><pre class=\"ql-syntax\" spellcheck=\"false\">security:\n  basic:\n    enabled: false\nmanagement:\n  security:\n    enabled: false\n</pre><p>来禁用的，但是2.0由于安全和歧义，security相关配置项去除了，那么集成shiro就没效果。</p><p>通过在启动主方法添加注解：</p><pre class=\"ql-syntax\" spellcheck=\"false\">@EnableAutoConfiguration(exclude = {\n        org.springframework.boot.autoconfigure.security.servlet.SecurityAutoConfiguration.class\n})\n</pre><p><span style=\"color: rgb(61, 70, 77);\">来禁止security自动启动配置，达到shiro集成效果，具体shiro集成和boot 1.x相同，具体可参考我之前集成shiro的博文：</span><a href=\"https://my.oschina.net/u/3312115/blog/1600830\" target=\"_blank\" style=\"color: rgb(30, 112, 191); background-color: rgb(255, 255, 255);\">https://my.oschina.net/u/3312115/blog/1600830</a></p><p><br></p><p>当spring boot为2.0 后 spring 默认升级到5.0以上，spring mvc对静态资源拦截的自定义方案：继承</p><p><br></p><p>WebMvcConfigurerAdapter 实现 addResourceHandlers 已经过时</p><p>，用继承：WebMvcConfigurationSupport 来替代即可，这里有一点要特别注意的，就是 有且只能继承一次WebMvcConfigurationSupport 多次会出现部分失效问题。</p><p><br></p>', '21', '1', 'acfc0e9232f54732a5d9ffe9071bf572', 'a4a743bffe9711e7b472201a068c6482', '2018-11-19 21:39:09', '2018-11-25 19:45:42', '0');

